import React, { useEffect, useState } from "react"
import Table from 'react-bootstrap/Table';

function Users()
{
    const [users, setUsers] = useState([]);
    const [isLoading, setIsLoading] = useState(false);

    const fetchUserData = () => {
        setIsLoading(true);
        fetch("https://jsonplaceholder.typicode.com/users")
        .then(response => {
            return response.json()
        })
        .then(data => {
            setUsers(data)
            setIsLoading(false)
        })
    };

    useEffect(() => {
        fetchUserData()
    }, []);

    return(
        <>
            <h1>Users </h1>
            
            { isLoading && (
                <h3>Loading</h3>
            ) }
            {users.length > 0 && (
                <Table  striped bordered hover size="sm">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Username</th>
                        </tr>
                    </thead>
                    <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                            <td>{user.username}</td>
                        </tr>
                    ))}
                    </tbody>
                </Table>
            )}
        </>
    )
}

export default Users;
